import React from "react";
import Sidebar from "../components/sidebar";
import { Container, Row, Col } from "react-bootstrap";
import DailyIntakeTable from "../components/intakes_mealstable";
import SearchBar from "../components/searchbar";

const currentDate = new Date();
const formattedDate = currentDate.toISOString().split('T')[0];

const Dailyintakes = () => {
  // Sample data
  const dataTemplate = {
    Userid: 0,
    Date: formattedDate,
    Hrsofsleep: 0,
    Glassesofwater: 0,
    Stepstaken: 0,
    Caloricintake: 0,
    Caloricdiversity: 0,
    HALE: 0,
    PHD: 0,
    Mealid: [1,2,3],
  };
  
  const data = Array.from({ length: 30 }, (_, index) => ({
    ...dataTemplate,
    Userid: index + 1,
    Hrsofsleep: Math.floor(Math.random() * 11),
    Glassesofwater: Math.floor(Math.random() * 11),
    Stepstaken: Math.floor(Math.random() * 11),
    Caloricintake: Math.floor(Math.random() * 11),
    Caloricdiversity: Math.floor(Math.random() * 11),
    HALE: Math.floor(Math.random() * 11),
    PHD: Math.floor(Math.random() * 11),
  }));
  
  const currentUser = {
    id: 1,
    name: "John Doe",
  };

  const handleLogout = () => {
    // Add your logout logic here
    // For example, redirect to the login page or clear the user session
    console.log("Logout clicked");
  };

  return (
    <Container fluid>
      <Row>
        <Col md={2}>
          <Sidebar />
        </Col>
        <Col md={10}>
          <div>
            <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center" }}>
              <h2 style={{ marginTop: "20px", marginBottom: "20px", color: "#9FC856", fontWeight: "600" }}>Daily Intakes</h2>
              <div style={{ display: "flex", alignItems: "center" }}>
                <span style={{ marginRight: "10px" }}>{currentUser.name}</span>
                <div className="dropdown">
                  <button className="btn btn-secondary dropdown-toggle" type="button" id="userDropdown" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                    Settings
                  </button>
                  <div className="dropdown-menu" aria-labelledby="userDropdown">
                    <a className="dropdown-item" href="#">Edit Profile</a>
                    <a className="dropdown-item" href="#">Change Password</a>
                    <div className="dropdown-divider"></div>
                    <a className="dropdown-item" href="#" onClick={handleLogout}>Logout</a>
                  </div>
                </div>
              </div>
            </div>
            <SearchBar />
            <DailyIntakeTable data={data} type={0} />
          </div>
        </Col>
      </Row>
    </Container>
  );
};

export default Dailyintakes;
